import React from 'react';
import InstagramEmbed from 'react-instagram-embed';
import { FacebookProvider, Feed } from 'react-facebook';
import { makeStyles } from '@material-ui/core/styles';

const useStyles = makeStyles({
    container: {
        height: '100vh'
    },
    outerInsta: {
        marginLeft: '10vw',
        marginTop: '10vh',
        width: '24vw',
        overflow: 'hidden'
    },
    instagram: {
        height: '80vh',
        width: '25vw',
        overflowY: 'scroll',
        paddingRight: '-10vw'
    },
    facebook: {
        marginLeft: '30vw',
        marginTop: '10vh',
        width: '10vw'
    }
});

export default function SectionSocial(props) {
    const classes = useStyles();
    return (
        <div className={classes.container}>
            <div className={classes.outerInsta}>
                <div className={classes.instagram}>
                    <InstagramEmbed
                        url='https://www.instagram.com/p/B_SYE5VjswK/'
                        maxWidth={480}
                        hideCaption={false}
                        containerTagName='div'
                        protocol=''
                        injectScript
                        onLoading={() => { }}
                        onSuccess={() => { }}
                        onAfterRender={() => { }}
                        onFailure={() => { }}
                    />
                </div>
            </div>
            <div className={classes.facebook}>
                <FacebookProvider appId="123456789">
                    <Feed link="https://www.facebook.com">
                        {({ handleClick }) => (
                            <button type="button" onClick={handleClick}>Share on Feed</button>
                        )}
                    </Feed>
                </FacebookProvider>
            </div>
        </div>
    );
}
